  [],\n\t\"revision_timestamp\": \"2015-09-27T01:52:00.032465\",\n\t\"name\": \"nodc-standard-product-texas-louisiana-shelf-circulation-and-transport-processes-study-hydrograp\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Louisiana-Texas Shelf Physical Oceanography
  Program (LATEX) was sponsored by the Minerals Management Service (MMS) of the U.S.
  Department of the Interior. Of its three study units, the Texas-Louisiana Shelf
  Circulation and Transport Processes Study (LATEX A or LATEX Shelf) was conducted
  by the Texas A&M University System. The LATEX A field program ran from April 1992
  to December 1994. The study area encompassed the Texas-Louisiana continental shelf
  offshore of approximately the 10-m isobath, from the Mississippi River to the Rio
  Grande. The five major field components were: moored current meter measurements,
  drifting buoys, hydrography, acoustic Doppler current profiling (ADCP), and meteorological
  buoys.nnThis is the fifth and final CD-ROM from the LATEX A program. It contains
  hydrographic, ADCP, drifting buoy, and expendable probe data collected during the
  LATEX A field program. The final data reports for these data sets are also included
  on this CD-ROM in PDF format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
